import React from "react"

function Chatbot (props) {
  return (
    <div>
      <header>
        Chatbot
      </header>
      <div>
        <Channels channels={props.data}/>
        <Chats />
      </div>
    </div>
  )
}

const Channels = props => (
  <div>
    <ChannelList channels={props.channels}/>
  </div>
)

function ChannelList (props) {
  return (
    <div>
      <Channel channel={props.channels[0]}/>
    </div>
  )
}

const Channel = props => (
  <button class channel-button>
    {props.channel.title} ||
    status: {props.channel.status}
  </button>
)

function Chats () {
  return (
    <div>
      <header>
        Chats
      </header>
    </div>
  )
}

export default Chatbot
